import React, {Component} from "react";
import SecureTemplate from "../../common/ui/SecureTemplate/SecureTemplate";

export default class CrudMaintainView extends Component {
	constructor(props) {
		super(props);

		this.state = {
			form: {
				name: "",
				cpf: "",
				password: "",
				passwordConfirm: "",
				zipCode: "",
				neighborhood: "",
				city: "",
				state: "",
			},

		};
	}

	async componentDidMount() {
	}

	handleSubmit = event => {

	}


	handleChangeForm = event => {
		this.setState({
			form: {...this.state.form, [event.target.id]: event.target.value},
		});
	};


	render() {
		return (
			<SecureTemplate>
				<div className="main-content">
					<div className="section__content section__content--p30">
						<div className="container-fluid">
							<div className="row text-center">
								<div className="col-xs-12 col-sm-12 col-md-12 col-lg-12">
									<div className="overview-wrap">
										<h2 className="title-1">CRUD - Cadastrar</h2>
									</div>
								</div>
							</div>

							<div className="card m-t-20">
								<div className="card-header">
									<h5>Dados Pessoais</h5>
								</div>

								<div className="card-body card-block">
									<div className="row">
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
											<label>Nome:</label>
											<input className="au-input au-input--full"
												required={true}
												id="name"
												name="name"
												value={this.state.form.name}
												onChange={this.handleChangeForm}
												placeholder="Nome"/>
										</div>
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
											<label>CPF:</label>
											<input className="au-input au-input--full"
												required={true}
												id="cpf"
												name="cpf"
												maxLength={14}
												value={this.state.form.cpf.onlyNumbers().maskCPF()}
												onChange={this.handleChangeForm}
												placeholder="CPF"/>
										</div>
									</div>
									<div className="row m-t-20">
										<div className="col-lg-6">
											<label>Email</label>
											<input className="au-input au-input--full"
												type="email"
												required={true}
												id="email"
												name="email"
												value={this.state.form.email}
												onChange={this.handleChangeForm}
												placeholder="Email"/>
										</div>
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
											<label>Email Confirmacao</label>
											<input className="au-input au-input--full"
												type="email"
												required={true}
												id="email"
												name="email"
												value={this.state.form.emailConfirm}
												onChange={this.handleChangeForm}
												placeholder="Email"/>
										</div>
									</div>
									<div className="row m-t-20">
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
											<label>Senha:</label>
											<input className="au-input au-input--full"
											       type="password"
											       required={true}
											       id="password"
											       name="password"
											       value={this.state.form.password}
											       onChange={this.handleChangeForm}
											       placeholder="Senha"/>
										</div>
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
											<label>Senha Confirmacao:</label>
											<input className="au-input au-input--full"
														type="password"
														required={true}
														id="password"
														name="password"
														value={this.state.form.passwordConfirm}
														onChange={this.handleChangeForm}
														placeholder="Senha"/>
										</div>
									</div>
								</div>

							</div>

							<div className="card m-t-20">
								<div className="card-header">
									<h5>Endere√ßo</h5>
								</div>
								<div className="card-body card-block">
									<div className="row">
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
												<label>CEP:</label>
												<input className="au-input au-input--full"
													   required={true}
													   id="zipCode"
													   name="zipCode"
													   value={this.state.form.zipCode}
													   onChange={this.handleChangeForm}
													   placeholder="CEP"/>
										</div>
									</div>
									<div className="row m-t-15">
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
												<label>Bairro:</label>
												<input className="au-input au-input--full"
													   required={true}
													   id="neighborhood"
													   name="neighborhood"
													   value={this.state.form.neighborhood}
													   onChange={this.handleChangeForm}
													   placeholder="Bairro"/>
										</div>
										<div className="col-xs-12 col-sm-12 col-md-6 col-lg-6">
												<label>Cidade:</label>
												<input className="au-input au-input--full"
													   required={true}
													   id="neighborhood"
													   name="neighborhood"
													   value={this.state.form.neighborhood}
													   onChange={this.handleChangeForm}
													   placeholder="Bairro"/>
										</div>
									</div>
								</div>
							</div>

						</div>
					</div>
				</div>
			</SecureTemplate>
		);
	}
}
